import React from "react";
import '../Month.css';
import Week from "./Week";
import Set from "./Set";

const Month = () => {
    return <div style={{
        padding: '70px 30px 0px 280px'
    }}>
        <Set />
        <h3 style={{textAlign:"left"}}>2022.2 DDL List</h3>
        <button href={""} style={{margin:"20px 20px 300px 800px"}}>Explore to Google Calendar</button>
        <Week />
    </div>;
};

export default Month;
